import AppHeader from '../app-header/app-header';
import SearchPanel from '../serh-panel/serh-panel';
import postStatusFilter from '../post-status-filter/post-status-filter';

const App = () =>{
    return(
        <div className = "app">
            <AppHeader/>
            <div className = "searc-panel d-dlex">
                <SearchPanel/>
            </div>
        </div>
        );
}

export default App;
